import React, { useState, useEffect } from 'react';
import { getJurisdictions } from '../../services/JurisdictionService/jurisdictionService';
import { calculateTax } from '../../services/TaxCalculationService/taxCalculationService';
import './TaxCalculator.css';

const TaxCalculator = () => {
  const [jurisdictions, setJurisdictions] = useState([]);
  const [customerInfo, setCustomerInfo] = useState({
    name: '',
    email: '',
    country: 'US',
    state_province: '',
    city: '',
    zip_postal: ''
  });
  const [products, setProducts] = useState([
    {
      id: 1,
      name: '',
      type: 'Digital Software',
      price: '',
      quantity: 1
    }
  ]);
  const [taxSummary, setTaxSummary] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  useEffect(() => {
    loadJurisdictions();
  }, []);

  const loadJurisdictions = async () => {
    try {
      const data = await getJurisdictions();
      setJurisdictions(data);
    } catch (err) {
      setError('Failed to load jurisdictions');
      console.error(err);
    }
  };

  const handleCustomerChange = (e) => {
    const { name, value } = e.target;
    setCustomerInfo({
      ...customerInfo,
      [name]: value
    });
  };

  const handleProductChange = (index, field, value) => {
    const updatedProducts = [...products];
    updatedProducts[index][field] = value;
    setProducts(updatedProducts);
  };

  const addProduct = () => {
    setProducts([
      ...products,
      {
        id: products.length + 1,
        name: '',
        type: 'Digital Software',
        price: '',
        quantity: 1
      }
    ]);
  };

  const removeProduct = (index) => {
    if (products.length === 1) {
      return; // Don't remove the last product
    }
    const updatedProducts = products.filter((_, i) => i !== index);
    setProducts(updatedProducts);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate form
    if (!customerInfo.name || !customerInfo.country) {
      setError('Please fill in all required customer fields');
      return;
    }

    for (const product of products) {
      if (!product.name || !product.price || !product.quantity) {
        setError('Please fill in all product details');
        return;
      }
    }

    setLoading(true);
    setError('');

    try {
      const calculationData = {
        customer: customerInfo,
        products: products.map(p => ({
          name: p.name,
          type: p.type,
          price: parseFloat(p.price),
          quantity: parseInt(p.quantity)
        }))
      };

      const result = await calculateTax(calculationData);
      setTaxSummary(result);
    } catch (err) {
      setError('Tax calculation failed: ' + err.message);
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  // Get states/provinces based on selected country
  const getStateOptions = () => {
    const states = jurisdictions
      .filter(j => j.country === customerInfo.country)
      .map(j => j.state_province)
      .filter((value, index, self) => value && self.indexOf(value) === index);

    return states;
  };

  return (
    <div className="tax-calculator-page">
      <div className="page-header">
        <h1>Tax Calculator</h1>
        <p className="page-description">
          Calculate sales tax for digital products based on customer location and product type.
        </p>
      </div>

      {error && <div className="alert alert-danger">{error}</div>}

      <form onSubmit={handleSubmit}>
        <div className="form-section">
          <h2 className="section-title">Customer Information</h2>

          <div className="form-row">
            <div className="form-group">
              <label htmlFor="name">Customer Name *</label>
              <input
                type="text"
                id="name"
                name="name"
                value={customerInfo.name}
                onChange={handleCustomerChange}
                className="form-control"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="email">Email</label>
              <input
                type="email"
                id="email"
                name="email"
                value={customerInfo.email}
                onChange={handleCustomerChange}
                className="form-control"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label htmlFor="country">Country *</label>
              <select
                id="country"
                name="country"
                value={customerInfo.country}
                onChange={handleCustomerChange}
                className="form-control"
                required
              >
                <option value="">Select Country</option>
                <option value="US">United States</option>
                <option value="CA">Canada</option>
                <option value="UK">United Kingdom</option>
                <option value="AU">Australia</option>
                <option value="DE">Germany</option>
                <option value="FR">France</option>
              </select>
            </div>

            <div className="form-group">
              <label htmlFor="state_province">State/Province</label>
              <select
                id="state_province"
                name="state_province"
                value={customerInfo.state_province}
                onChange={handleCustomerChange}
                className="form-control"
              >
                <option value="">Select State/Province</option>
                {getStateOptions().map(state => (
                  <option key={state} value={state}>{state}</option>
                ))}
              </select>
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label htmlFor="city">City</label>
              <input
                type="text"
                id="city"
                name="city"
                value={customerInfo.city}
                onChange={handleCustomerChange}
                className="form-control"
              />
            </div>

            <div className="form-group">
              <label htmlFor="zip_postal">ZIP/Postal Code</label>
              <input
                type="text"
                id="zip_postal"
                name="zip_postal"
                value={customerInfo.zip_postal}
                onChange={handleCustomerChange}
                className="form-control"
              />
            </div>
          </div>
        </div>

        <div className="product-section">
          <h2 className="section-title">Products</h2>

          <div className="product-list">
            {products.map((product, index) => (
              <div key={product.id} className="product-item">
                <div className="product-header">
                  <h3 className="product-title">Product {index + 1}</h3>
                  {products.length > 1 && (
                    <button 
                      type="button" 
                      className="product-remove"
                      onClick={() => removeProduct(index)}
                    >
                      <i className="fas fa-times"></i> Remove
                    </button>
                  )}
                </div>

                <div className="product-fields">
                  <div className="form-group">
                    <label htmlFor={`product-name-${index}`}>Product Name *</label>
                    <input
                      type="text"
                      id={`product-name-${index}`}
                      value={product.name}
                      onChange={(e) => handleProductChange(index, 'name', e.target.value)}
                      className="form-control"
                      required
                    />
                  </div>

                  <div className="form-group">
                    <label htmlFor={`product-type-${index}`}>Product Type *</label>
                    <select
                      id={`product-type-${index}`}
                      value={product.type}
                      onChange={(e) => handleProductChange(index, 'type', e.target.value)}
                      className="form-control"
                      required
                    >
                      <option value="Digital Software">Digital Software</option>
                      <option value="E-book">E-book</option>
                      <option value="Digital Media">Digital Media</option>
                      <option value="Online Service">Online Service</option>
                    </select>
                  </div>

                  <div className="form-group">
                    <label htmlFor={`product-price-${index}`}>Price ($) *</label>
                    <input
                      type="number"
                      id={`product-price-${index}`}
                      value={product.price}
                      onChange={(e) => handleProductChange(index, 'price', e.target.value)}
                      className="form-control"
                      step="0.01"
                      min="0"
                      required
                    />
                  </div>

                  <div className="form-group">
                    <label htmlFor={`product-quantity-${index}`}>Quantity *</label>
                    <input
                      type="number"
                      id={`product-quantity-${index}`}
                      value={product.quantity}
                      onChange={(e) => handleProductChange(index, 'quantity', e.target.value)}
                      className="form-control"
                      min="1"
                      required
                    />
                  </div>
                </div>
              </div>
            ))}
          </div>

          <button 
            type="button" 
            className="add-product-button"
            onClick={addProduct}
          >
            <i className="fas fa-plus"></i> Add Another Product
          </button>
        </div>

        <div className="form-actions">
          <button 
            type="submit" 
            className="btn btn-primary"
            disabled={loading}
          >
            {loading ? 'Calculating...' : 'Calculate Tax'}
          </button>
        </div>
      </form>

      {taxSummary && (
        <div className="summary-section">
          <h2 className="summary-title">Tax Calculation Results</h2>

          <div className="summary-row">
            <div className="summary-label">Subtotal:</div>
            <div className="summary-value">${taxSummary.subtotal.toFixed(2)}</div>
          </div>

          <div className="summary-row">
            <div className="summary-label">Tax Rate:</div>
            <div className="summary-value">{(taxSummary.tax_rate * 100).toFixed(2)}%</div>
          </div>

          <div className="summary-row">
            <div className="summary-label">Tax Amount:</div>
            <div className="summary-value">${taxSummary.tax_amount.toFixed(2)}</div>
          </div>

          <div className="total-row">
            <div>Total:</div>
            <div>${taxSummary.total.toFixed(2)}</div>
          </div>

          <div className="tax-details">
            <h3>Tax Details</h3>
            <p>
              <strong>Jurisdiction:</strong> {taxSummary.jurisdiction || 'N/A'}
            </p>
            <p>
              <strong>Tax Rules Applied:</strong> {taxSummary.tax_rules_applied || 'Standard rate'}
            </p>
          </div>
        </div>
      )}
    </div>
  );
};

export default TaxCalculator;
